INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7503019426067', 'Bake´s Duo pack Pepperoni & Chicken', 'INGREDIENTES: Masa: harina de trigo, agua, sal yodada, aceite vegetal, azúcar refinada y levadura. Relleno Chicken Bake: pechuga de pollo [26%], mezcla de quesos (leche semidescremada y pasteurizada de vaca, cultivos lácticos, sal yodada y enzimas), cebolla, tocino [3%] y aderezo (agua, crema ácida, aceite vegetal, vinagre blanco, leche en polvo, huevo, azúcar, sal yodada, ácido citrico, especias y condimentos) y ácido propiónico como conservador. Relleno Pepperoni Bake: pepperoni [19%] (carne de cerdo, grasa de cerdo, especias y condimentos, sal yodada, proteína láctea, azúcar refinada, nitritos, nitratos y cultivos lácticos), mezcla de quesos (leche descremada y pasteurizada de vaca, cultivos lácticos, sal yodada y enzimas), salsa de tomate (tomate, agua, almidón modificado de maíz, azúcar refinada, sal yodada, cebolla, especias y condimentos), tocino [4% y cebolla. Cubierta: queso parmesano (leche pasteurizada y parcialmente descremada de vaca, cultivos de queso, sal yodada y enzimas) y barniz (agua, huevo, aceite vegetal y leche en polvo)', 'https://static.openfoodfacts.org/images/products/750/301/942/6067/front_es.7.400.jpg', '8', '4', '23', '1', '2', '16', '0.96266', '0.379', '', '1');

