INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7503021936004', 'Pay Helado de limón', 'Leche condensada (leche parcialmente descremada de vaca y azúcar refinada pasteurizados), galleta de vainilla (harina de trigo, azúcar refinada, grasa vegetal jarabe de maíz de alta fructuosa, sal yodada, bicarbonato de sodio, lecitina de soya, bicarbonato de amonio, saborizante artificial, vitaminas (vitamina C, vitamina E, hierro, vitamina A, vitamina B3, zinc yodo, vitamina B2, vitamina B1, vitamina B12, acido fólico) y colorante artificial No. 5), azúcar refinada, crema para batir (agua, grasa animal, grasa vegetal descremada rehidratada, mono y diglicéridos o monoestearato de sorbitol cloruro de sodio, alginato de sodio o goma xantana, goma guar o algarrobo, sabor artificial y azúcar refinada), agua, clara de huevo pasteurizada, crema dulce (crema de leche de vaca, estabilizador (goma guar, goma algarrobo, carboximetil-celulosa de sodio y goma xantana), yema de huevo pasteurizada, margarina (aceites comestibles de cártamo parcialmente hidrogenado y sin hidrogenar, agua, sal yodada, lecitina de soya, mono y diglicéridos de ácidos grasos, benzoato de sodio, saborizante artificial, ácido citrico y betacaroteno), glucosa, jugo de limón, fibra de avena, almidón modificado de maíz, conservador (ácido propiónico, benzoato de sodio, ácido citrico, sorbato de potasio, ácido Sórbico y extracto de toronja), goma xantana, carragenina, cremor tártaro y alginato de sodio.', 'https://static.openfoodfacts.org/images/products/750/302/193/6004/front_es.9.400.jpg', '13', '7', '46', '33', '4', '4', '0.58928', '0.232', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7503021936028', 'Cheesecake con zarzamora', 'Pay de queso: queso crema (leche pasteurizada de vaca, crema de leche pasteurizada de vaca, sal yodada, goma de algarrobo, cloruro de calcio, cuajo y cultivos lácteos), galleta (harina de trigo, azúcar, grasa vegetal comestible (TBHQ, palmitato de ascorbilo y tocoferoles), sal yodada, bicarbonato de sodio, bicarbonato de amonio, lecitina de soya, saborizante artificial vainilla, estearoil lactilato de sodio, metabisulfito de sodio, ácido cítrico, mezcla vitamínica (Vitamina A, Vitamina D3, Vitamina B3, Vitamina B5, Vitamina B1, Vitamina B2, Vitamina B6, Vitamina B9 y Vitamina B12), hierro, zinc, amarillo No. 5 y amarillo No.6), azúcar refinada, crema natural (crema de leche pasteurizada de vaca, aceite de soya parcialmente hidrogenado, leche descremada rehidratada, estabilizador (goma guar, goma de algarrobo, carboximetil celulosa de sodio, fosfato de sodio, fosfato dibásico de sodio y goma xantana), huevo entero, margarina (aceites vegetales comestibles parcialmente hidrogenados y sin hidrogenar, agua, sal yodada, lecitina de Soya, mono y diglicéridos de ácidos grasos, benzoato de sodio, sorbato de potasio, ácido cítrico, betacaroteno, BHA, BHT y saborizante artificial), harina de trigo enriquecida, goma xantana, agua y conservador (extracto estandarizado de semillas de cítricos, glicerina y agua).  Salsa de zarzamora: zarzamoras (45 %), jarabe de alta fructosa, jarabe de glucosa, azúcar refinada, almidón modificado, ácido citrico, benzoato de sodio y sorbato de potasio (como conservador), colorante rojo 40 y colorante azul 1.', 'https://static.openfoodfacts.org/images/products/750/302/193/6028/front_es.8.400.jpg', '19', '5', '34', '20', '0', '5', '0.05334', '0.021', '', '1');

